import { Link as LinkBase } from "react-router-dom";

const Link = ({ to, children, className }) => {
  const rippleRef = React.useRef(null);

  return (
    <div
      style={{
        position: "relative",
        minWidth: "184px",
      }}
    >
      <LinkBase className={className ? className + " link" : "link"} to={to}>
        {children}
      </LinkBase>
      <span className="ripple" />
    </div>
  );
};

export default Link;
